import { Btn, Container, Content, MenuLogin } from './styles';

export function HomePage() {
  return (
    <Container>
      <Content>
        <LogoLight />
        <MenuLogin>
          <Btn type="button">Login</Btn>
          {/* <button type="button">Cadastrar-se</button>
          <button type="button">Esqueci minha senha</button> */}
        </MenuLogin>
      </Content>
    </Container>
  );
}
